router.get('/nota/:id', async(req, res)=>{
    const _id=req.params.id;
    try{

        const notaDB=await Nota.findOne({_id});
        res.json(notaDB);

    } catch (error){
        return res.status(500).json({
            mensaje:'Ocurrio un error',
            error
        })
    }
});


//GET para todos los elementos

